function AcoesCards({acoes}){
    return(
        <>
            {acoes && acoes.map(acao=>(
                <div>
                    <h3>{acao.nomeAcao}</h3>
                    <p><span>Valor:</span>{acao.valor}</p>
                    <p><span>Data:</span>{acao.dataDaAcao}</p>
                    <p><span>Tipo:</span>{acao.tipo}</p>
                </div>
            )
            )}
        </>
    )
}

export default AcoesCards
